  type: "Field"
  package: "com.google.cloud.speech.v1beta1"
  summary: "```\nSpeech has ceased to be detected in the audio stream. (For example, the\n user may have paused after speaking.) If `single_utterance` is `false`,\n the service will continue to process audio, and if subsequent speech is\n detected, will send another START_OF_SPEECH event.\n```\n\n`END_OF_SPEECH = 2;`"
  syntax:
    content: "public static final StreamingRecognizeResponse.EndpointerType END_OF_SPEECH"
    return:
      type: "com.google.cloud.speech.v1beta1.StreamingRecognizeResponse.EndpointerType"
